import React, { Fragment } from "react";
import { Box, Grid } from "@material-ui/core";

const Movements = () => {
  return (
    <Fragment>
      HOLA MOVEMNTS
      <Grid container>
        <Grid item xs={12} sm={6} md={12} >
          <Box border={2} p={8}>BOX UNO</Box>
        </Grid>

        <Grid item xs={12} sm={6} md={12} p={8}>
          <Box border={2} p={8}>
            BOX DOS
          </Box>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default Movements;
